column8:
本商品はカーボンをリアルに再現し内装、外装どちらでも対応できるドレスアップシートです。<br>
生地がとても伸びやすい為、細部までキレイに貼付ける事が可能です。<br>
さらに、高耐候品なので、屋外パーツへの貼付けも可能です。<br>
<br><br>
